import React, { useState, useEffect } from "react";



export const Mission = () => {

    const [missionData, handleMissionData] = useState([])



    var awaitHelper = function awaitHelper(promise: any) {
        return promise.then(function (data: any) {
            return {
                data: data,
                error: null
            };
        })["catch"](function (error: any) {
            return {
                error: error,
                data: null
            };
        });
    };


    async function getUserAsync() {
        let response = await awaitHelper(fetch(`https://api.spacexdata.com/v3/launches?limit=100`));
        let data = await response.json()
        return handleMissionData(data);
    }

    useEffect(() => {
        getUserAsync();
    }, []);


    console.log("-->", missionData)
    return (
        <div>
        </div>
    )

}
